import React, { Suspense } from 'react';
import Loading from '../MatxLoading/MatxLoading'

const Loadable = (Component) => (props) => (
   <Suspense fallback={<Loading />}>
      <Component {...props} />
   </Suspense>
);

export default Loadable;
